instance Ord Packet where
    (Num a) <= (Num b) = a<=b
    (Num a) <= (L b) = (L [Num a])<= (L b)
    (L a) <= (Num b) = (L a) <= (L [Num b])
    (L []) <= (L []) = True
    (L []) <= (L b) = True
    (L a) <= (L []) = False
    (L as) <= (L bs) = if( head as== head bs) then (L (tail as))<= (L (tail bs)) else  head as<= head bs

instance Eq Packet where
    (Num a) == (Num b) = a==b
    (Num a) == (L b) = (L [Num a])== (L b)
    (L a) == (Num b) = (L a) == (L [Num b])
    (L []) == (L []) = True
    (L []) == (L b) = False
    (L a) == (L []) = False
